import React from 'react';
import './index.css';
import Pokemon from './Components/Pokemon';


class App extends React.Component {
  render() {
    return (
      <main>
        <div>
          <h1>Pokedex</h1>
          <section>
          {
          <Pokemon />

          }
          </section>
        </div>
      </main>
    )
  }
}

export default App;
